INSERT INTO `libraries` VALUES (9,1,'Предложение с to be и прилагательным. Настоящее время. Утверждение','2021-12-21 17:58:08','2021-12-21 17:58:08','Мы тут будем практиковаться в to be в настоящем времени утверждение. Тут больше будет практики предложении по To Be'),(10,1,'Предложение с to be и прилагательным. Настоящее время. Отрицание','2021-12-21 18:48:57','2021-12-21 18:48:57',NULL),(11,1,'Предложение с to be и прилагательным. Настоящее время. Вопрос','2021-12-21 18:54:10','2021-12-21 18:54:10',NULL),(12,1,'Предложение с to be и прилагательным. Настоящее время. Смешанно','2021-12-21 18:59:21','2021-12-21 18:59:21',NULL),(13,1,'Предложение с to be и прилагательным. Прошлое время. Утверждение','2021-12-21 18:59:33','2021-12-21 18:59:33',NULL),(14,1,'Предложение с to be и прилагательным. Прошлое время. Отрицание','2021-12-21 18:59:45','2021-12-21 18:59:45',NULL),(15,1,'Предложение с to be и прилагательным. Прошлое время. Смешанное','2021-12-21 18:59:54','2021-12-21 18:59:54',NULL),(16,1,'Предложение с to be и прилагательным. Прошлое время. Вопрос','2021-12-21 19:00:09','2021-12-21 19:00:09',NULL),(18,1,'Прилагательные','2021-12-23 18:30:52','2021-12-23 18:30:52',NULL),(19,1,'Существительные','2021-12-23 18:35:50','2021-12-23 18:35:50',NULL),(20,1,'Вот это английский - Интервью','2021-12-23 19:00:09','2021-12-23 19:00:09','Тут будут все слова из интервью от канала ВОТ ЭТО Английский'),(21,1,'Глагол To Be с существительным','2021-12-24 17:46:08','2021-12-24 17:46:08',NULL),(22,1,'Глагол To Be с существительным и c прилагательным','2021-12-24 17:57:59','2021-12-24 17:57:59',NULL),(24,1,'To be - (I am your friend)','2021-12-30 18:18:00','2021-12-31 18:46:25','Схема: Личное местоимение + to be + притяжательное местоимение + существительное'),(25,1,'To be - (I am your good friend)','2021-12-31 18:40:34','2021-12-31 18:41:59','Схема: Подлежащее + to be + притяжательное местоимение + прилагательное + существительное'),(26,1,'To be - (The/(His,her etc.) boy is stupid )','2022-01-04 17:02:38','2022-01-04 17:02:38','Схема: Существительное-подлежащее + to be + прилагательное/существительное'),(28,2,'IT-cлова','2022-01-04 17:12:41','2022-01-04 17:12:41',NULL),(32,1,'To be - (That/this boy is stupid)','2022-01-04 17:32:59','2022-01-04 17:32:59','Cхема: \r\nThis/That + существительное + to be + прилагательное | прилагательное с существительным'),(33,1,'To be - (Those, These boys is stupid)','2022-01-04 17:34:00','2022-01-04 17:34:00','Cхема: \r\nThose/These + существительное + to be + прилагательное | прилагательное с существительным'),(34,1,'Предложные обороты','2022-01-05 17:44:51','2022-01-05 17:44:51','Предложный оборот - это сочетание слов по смыслу близкое к наречию но он состоит из предлога с существительным/прилагательным\r\nПример:\r\nIn the morning - Утром\r\nIn the park - В парке'),(35,1,'Предлоги','2022-01-06 17:49:22','2022-01-06 17:49:22','Тут мы будем описывать предлоги'),(36,1,'To be - c обстоятельствами','2022-01-06 18:22:39','2022-01-06 18:29:11','Схема:\r\nПодлежащее + to be + существительное/прилагательное + предлоги  + обстоятельство (места и времени)\r\n\r\nI am a doctor since tomorrow'),(37,1,'Оборот there + to be: наличие отсутствие','2022-01-30 18:44:41','2022-01-30 18:44:41',NULL),(38,1,'Притяжательное местоимение-существительное (it is mine)','2022-01-30 18:45:24','2022-01-30 18:45:24','Притяжательное местоимение-существительное— это разновидность притяжательного местоимения, которая в предложении используется не как определитель существительного, а как само существительное, заменяя его. \r\n\r\nТ.е это не как my используется, а как само my и существительное вместе'),(39,1,'Вопросительные словосочетания','2022-01-30 18:47:01','2022-01-30 18:47:01','Вопросительные слова, особенно **what** и **how**, часто присоединяют к себе существительные, прилагательные, образуя вопросительные словосочетания — по сути, те же **WH-слова**, но\r\nв расширенном виде. Например:\r\n\r\n- What colour - какого цвета?\r\n- What kind of - какого рода, вида\r\n- How long - Как долго?\r\n- How much, How many - сколько?'),(40,1,'Специальные вопросы или вопрос WH','2022-01-30 18:50:14','2022-01-30 18:50:14','Cпециальные вопросы их еще называют, WH-questions (вопросы на WH), потому что они начинаются с вопросительных слов на буквы WH, не считая слова how:-\r\n\r\n- what - что\r\n- who - кто\r\n- where - где\r\n- why - почему\r\n- when - когда\r\n- whose - чей\r\n- which - какой, который (из нескольких)\r\n- how - как'),(41,1,'Количественные числители (один, два, три и т.д)','2022-02-07 17:04:47','2022-02-07 17:05:28','Пример: Один, два, три, четыре и т.д'),(42,1,'Порядковые числители (первый, второй и т.д)','2022-02-07 17:05:41','2022-02-07 17:05:41','Ну примеры: первый, второй, десятый и т.д'),(43,1,'Дни недели (Понедельник, вторник, среда и т.д)','2022-02-07 17:25:37','2022-02-07 17:25:37',NULL),(45,1,'Месяца','2022-02-09 16:57:10','2022-02-09 16:57:10',NULL),(46,1,'Практика времени (годы, месяцы, дни недели и время)','2022-02-09 18:27:24','2022-02-09 18:28:06','Будет практика по этим вещам'),(47,1,'Сравнительная степень (Его машина быстрее чем моя)','2022-02-12 16:32:06','2022-02-12 16:35:04','Сравнительная степень - это когда мы \"что-то\" сравниваем с \"чем-то\", например: \r\nОн лучше чем я.\r\nМоя машина быстрее чем его\r\n\r\nСравнительная степень делится на две подкатегорий: короткие и длинные \r\nА эти два категорий делятся на подкатегорий: сравнение в меньшую сторону и сравнение в большую.\r\n\r\nКороткие - это когда наше слово прилагательное состоит из одного слога, т.е наше слово не длинное (stupid, smart и т.д)\r\n\r\nИ теперь, когда мы хотим сравнивать короткое прилагательное в большую сторону, то мы к прилагательному добавляем суффикс -er. Пример:\r\nЯ умнее чем он \r\n\r\nУ нас тут сравнение идет в \"большую сторону\", т.е он говорит что он лучше кого-то, в большую сторону идет его самооценка >. И в этом случае, мы должны добавить к прилагательному \"умный\", суффикс -er. Вот конечный результат\r\n\r\nI am smarter than he - Я умнее чем он\r\n\r\nНу вот типа так, мы к smart добавляем суффикс -er, и тогда у нас \"умный\" превращается в \"умнее\", и дальше мы можем либо указать, чего он умнее, либо опустить это.\r\n\r\nТеперь будем указывать сравнение в меньшую сторону, выше у нас было в большую, а теперь наоборот. \r\nЧто значит сравнение в меньшую сторону? - это когда мы говорим что \"что-то\" менее лучше чего-то. Пример: \r\nЕго собака менее агрессивная чем моя - His dog is less aggressive than mine \r\n\r\nИ теперь чтобы мы могли выразить сравнение в \"меньшую сторону\", нам просто необходимо написать перед самим прилагательным, слово \"less\" (менее), а саму форму прилагательного на -er мы не меняем, почему?, потому что -er это форма сравнения в \"большую сторону\". Т.е Чтобы сказать что что-то менее лучше чего-то, мы перед прилагательным ставим наречие (или прилагательное) \"less\":\r\n\r\nЯ менее тупой чем ты - I am less stupid than you\r\nМоя кошка менее странная чем твоя - My cat is less strange than yours.\r\n\r\nДлинные прилагательные\r\n\r\nДлинные прилагательные - это прилагательные которые состоят из более одного слога, т.е это длинные слова, наподобий: beautiful etc\r\n\r\nВ длинных прилагательных тоже есть степени сравнения: в большую и в меньшую сторону\r\n\r\nСтепень сравнения в *большую сторону*, образуется с помощью слова: more\r\n\r\nСтепень сравнения в *меньшую сторону*, образуется с помощью слова: less\r\n\r\nЗаметь сравнение в меньшую сторону выражается, у длинных и у коротких с одинаковым словом: less\r\n\r\nИ при сравнение в обе стороны, прилагательное не меняется, а просто добавляется свое слово каждой стороны\r\n\r\nПримеры:\r\n\r\nMy dog is **more** stupid  *than* yours. — Моя собака **более** глупая твоей.\r\n\r\nYour dog is **less** stupid *than* mine. — Твоя собака **менее** глупа, чем моя.\r\n\r\nMy city is **more** beautiful *than* yours. — Мой город **более** красив, чем ваш.\r\n\r\nMy city is **less** beautiful *than* yours. — Мой город **менее** красив, чем ваш.'),(48,1,'Превосходная степень (Я лучший)','2022-02-12 16:34:42','2022-02-12 16:34:42',NULL),(49,1,'Объектные местоимения (me, you, us, him, her)','2022-02-22 19:06:22','2022-02-22 19:06:22','Единственное число\r\nI — me\r\nyou — you\r\nhe/she/it — him/her/it\r\n\r\nМножественное число\r\nwe — us\r\nyou — you\r\nthey — them'),(51,1,'Глагол. Повелительное наклонение (Иди!, Бегай туда!)','2022-02-22 19:16:30','2022-02-22 19:16:30','Самое простое предложение со смысловым глаголом состоит из одного слова: глагола в начальной форме. И все.\r\nГлагол в начальной форме без какого-либо подлежащего автоматически превращается в глагол в повелительном наклонении, то есть в приказ:\r\nGo! — Иди!\r\nStop! — Стой!\r\nRead! — Читай!'),(52,1,'Глагол. Повелительное наклонение с дополнением','2022-02-22 20:09:43','2022-02-22 20:18:00','Дополнение — это объект действия, то, на что направлено действие. В предложении оно находится после глагола.\r\nСхема:\r\n| .... + глагол + дополнение + остальные члены предложения\r\n\r\nRead that book. \r\n\r\nДополнение может выражаться:\r\n* Существительным\r\n* Объектным местоимением'),(53,1,'Глагол. Present Simple. Я играю в шашки (не в данный момент)','2022-02-23 21:30:49','2022-02-23 21:33:07','Глагол в форме настоящего простого времени (PresentSimple) — это просто глагол в начальной форме без каких-либо окончаний, кроме одного случая, о котором \r\n\r\nВариации\r\nI work\r\nthey work\r\nyou work\r\nwe work\r\nshe works\r\nhe works\r\nit works\r\n\r\nCхема такова:\r\nПодлежащее + глагол + дополнение/обстоятельство + обстоятельство\r\n\r\n\r\nДля глаголов в Present Simple характерны обстоятельства, подчеркивающие регулярность, «обычность» действия, например:\r\n- every day - каждый день\r\n- all the time - постоянно, все время\r\n- often - часто\r\n- usually - обычно\r\n- regularly - регулярно\r\n- from time to time - время от времени\r\n- sometimes - иногда\r\n\r\nПример:\r\nI work usually - Я обычно работаю\r\nMy friend often runs in the park - Мой друг часто бегает в парке'),(54,1,'Глагол. Present Continuous. Я играю в игру сейчас (на данный момент)','2022-02-23 21:37:51','2022-02-23 21:37:51','Настоящее длительное время выражает действие в процессе, действие, происходящее в данный момент или промежуток времени.\r\n\r\nСхема:\r\nПодлежащее + глагол to be + глагол-ing + дополнение ....\r\n\r\nГлагол в Present Continuous часто употребляется с обстоятельством, указывающим на определенный момент или промежуток времени.\r\n- now - сейчас\r\n- at the moment - в данный момент\r\n- today - сегодня\r\n- this month - в этом месяце\r\n\r\nПримеры:\r\nHe is working now - Он сейчас работает\r\nМоя кошка сейчас играет в парке - My cat is playing at the park now\r\nОни сейчас идут домой - They are going at home now\r\nЯ жду тебя - I am waiting you'),(56,2,'Прилагательные. Цвета','2022-02-25 18:24:39','2022-02-25 18:24:39',NULL),(57,2,'Фразовые глаголы','2022-02-25 18:29:00','2022-02-25 18:29:14','Это те слова, которые не поддаются логике образования слов в английском, и они используются как есть.\r\n\r\nПример:\r\ngive up - По идеи, give - давать, а up - вверх, и тогда было бы \"давать что-то вверх\", но нет, это означает \"Сдаваться\"\r\n\r\nВот такие слова и существуют'),(59,2,'Глаголы (500). Наиболее употребляемые глаголы','2022-02-25 18:31:26','2022-02-25 18:31:26',NULL),(60,2,'Глагол (500). Основные глаголы движения','2022-02-25 18:31:49','2022-02-25 18:31:49',NULL),(61,2,'Глаголы (500). Речи, Общения','2022-02-25 18:32:15','2022-02-25 18:32:15',NULL),(62,2,'Глаголы (500). Обозначающие повседневные дела','2022-02-25 18:33:23','2022-02-25 18:33:23',NULL),(63,2,'Глаголы (500). Этапы Действия','2022-02-25 18:34:02','2022-02-25 18:34:02',NULL),(64,2,'Прилагательные. Различные качества и свойства','2022-02-25 18:45:56','2022-02-25 18:45:56',NULL),(65,2,'Прилагательное. Вес и Размер','2022-02-25 20:17:53','2022-02-25 20:17:53',NULL),(66,2,'Прилагательные. Качества, характер человека','2022-02-25 20:29:53','2022-02-25 20:29:53',NULL),(67,2,'Существительное (500). Единицы времени, слова на тему \"Время\"','2022-02-25 20:35:17','2022-02-25 21:02:19',NULL),(68,2,'Существительное (500). Месяцы, времена года, дни недели','2022-02-25 20:38:39','2022-02-25 20:38:39',NULL),(69,2,'Существительное (500). Семья и родственники','2022-02-25 20:40:37','2022-02-25 20:40:37',NULL),(70,2,'Существительное (500). Дом, одежда, предметы быта','2022-02-25 20:47:39','2022-02-25 20:47:39',NULL),(71,2,'Существительное (500). Природа','2022-02-25 20:50:13','2022-02-25 20:50:13',NULL),(72,2,'Существительное (500). Город','2022-02-25 20:53:52','2022-02-25 21:02:35',NULL),(73,2,'Cуществительное (500). Работа и деньги','2022-02-25 20:56:03','2022-02-25 20:56:03',NULL),(74,2,'Существительное (500). Еда и напитки','2022-02-25 20:58:12','2022-02-25 20:58:12',NULL),(75,2,'Cуществительное (500). Образование','2022-02-25 21:00:35','2022-02-25 21:00:35',NULL),(76,2,'Наречия (500). Наречия времени','2022-02-25 21:07:45','2022-02-25 21:07:45',NULL),(77,2,'Наречие (500). Наречие места','2022-02-25 21:10:46','2022-02-25 21:10:46',NULL),(78,2,'Наречие (500). Наречие меры и степени','2022-02-25 21:12:26','2022-02-25 21:12:26',NULL),(79,2,'Наречие (500). Наречие образа и действия','2022-02-25 21:13:37','2022-02-25 21:13:37',NULL),(80,2,'Существительное. Разное','2022-02-25 21:48:44','2022-02-25 21:48:44',NULL),(81,2,'Слова из манг, аниме, ранобэ','2022-02-25 21:52:17','2022-02-25 21:52:17',NULL),(82,1,'Глагол. Глаголы состояния','2022-03-15 20:16:24','2022-03-15 20:16:24','Ряд глаголов не принято употреблять в длительной форме, даже если действие происходит в настоящий момент. Это глаголы, выражающие действия и состояния, по своей природе не вполне поддающиеся переводу в длительную форму.\r\n\r\nНапример, легко представить, действие **to** **knock** (**стучать**) в виде *длительного*, *зацикленного* — кто-то стучит и стучит в дверь без перерыва. \r\n\r\nТрудно представить длительное действие **to understand** (**понимать**), **to** **respect** (**уважать**). Как можно длительно понимать или зацикленно уважать? Уважение и понимание — это, скорее, не действия, а **состояния**. Подобные глаголы так и называются — **глаголы** **состояния**.'),(83,2,'Все глаголы с указанием (тест)','2022-03-17 20:41:50','2022-03-17 20:41:50',NULL),(84,1,'Глаголы. Future Simple. Я тебя забаню (i will ban you)','2022-03-21 18:27:27','2022-03-21 18:29:10','Будущее простое время (Future Simple) строится одинаково во всех лицах и числах — добавляем will перед глаголом.\r\n\r\nПримеры:\r\n\r\nI will ban you - Я тебя забаню\r\n\r\nI will repair the TV - Я починю телевизор\r\n\r\nMy friend will go to the park tomorrow - Мой друг пойдет в парк завтра'),(85,1,'Глаголы. Future Continuous. Я буду идти домой','2022-03-21 18:28:37','2022-03-21 18:28:37',NULL),(86,1,'Неопределенные местоимения','2022-03-23 16:04:45','2022-03-23 18:00:38','Вы уже знакомы с неопределенными местоимениями something (что-то), somebody (кто-то). Познакомимся с еще несколькими похожими словами. Все они начинаются на some (какой-то), any (какой-либо, любой) или no (никакой).\r\n\r\nСлова с «body», «thing», «one» могут заменить существи-\r\nтельное, выступая в роли подлежащего или дополнения:'),(87,2,'Неопределенные местоимения','2022-03-23 16:07:55','2022-03-23 16:07:55',NULL),(88,2,'Разные не сортированные глаголы и также фразовые','2022-03-23 16:13:18','2022-03-23 16:13:29',NULL),(89,2,'Выражения','2022-03-23 17:40:41','2022-03-23 17:40:41',NULL),(90,1,'Примеры предложении с косвенным дополнением','2022-03-23 18:37:34','2022-03-23 18:37:34',NULL),(91,1,'Практика предложении. Глаголы Present/Future Simple/Continuous','2022-03-24 14:47:44','2022-03-24 14:47:53','Местоимения (i, we, they, he, she, it, you)\r\nПрилагательные (beautiful, good) \r\nСуществительные (Car, smartphone)\r\nОбстоятельства времени и места (at the moment, today, tomorrow)\r\nОпределители (That, those, this, these)\r\nПритяжательное местоимение (my, her, his, its, their, ours, your)\r\nМестоимения в объектном падеже (me, it, them, us, him, her, you)\r\nПритяжательное местоимение-существительное (mine, yours, his, hers, its, ours, theirs)\r\nМестоимение (each other)\r\nПредлог сравнения (like)\r\nПредлоги (From, about)\r\nПредлоги (unitil, during, with, before, after, in)\r\nПрямое дополнения (я убью тебя, я сломаю танк)\r\nКосвенное дополнения (я дам тебе мою книгу, они продают им наши вещи)\r\nПредлоги (much, many, little, few)\r\nУказание времени: Месяцы, дни недели, время, года\r\nНеопределенные местоимения (Something, Somebody, Somewhere, Anywhere, Nowhere, Anything, Nothing, Someone, Anybody, Nobody, No one, Sometimes)\r\nГлаголы состояния\r\n\r\nГлаголы: Present Simple, Present Continuous, Future Simple, Future Continuous'),(92,1,'Предлоги места','2022-03-24 16:28:16','2022-03-24 16:38:19','Запомните предлоги, которые используются, когда речь идет о положении предмета по отношению к другому предмету.\r\n\r\nabove — над чем-то\r\nThe sun is above us. — Солнце над нами.\r\n\r\nunder — под чем-то\r\nThe cat is under the table. — Кошка под столом.\r\n\r\n inside — внутри чего-то\r\nI found a coin inside the toaster. — Я нашел монету внутри тостера.\r\n\r\noutside (of) — вне чего-то, снаружи\r\nI waited outside. — Я ждал снаружи.\r\nThe wire is outside of the machine. — Провод находится снаружи ма-\r\nшины.\r\n\r\nin front of — перед чем-то\r\nShe was standing in front of the entrance. — Она стояла перед входом.\r\n\r\nbehind — позади чего-то\r\nSomeone was singing behind the wall. — Кто-то пел за стеной.\r\n\r\nbetween — между\r\nThere is a road between two buildings. — Между двумя зданиями\r\nесть дорога.'),(93,1,'Глаголы. Past simple. (Я играл здесь - i played here)','2022-04-05 19:38:24','2022-04-05 19:38:24',NULL),(94,1,'Глаголы. Past Continuous. (Я играл (длительно) здесь - i was playing here)','2022-04-05 19:38:55','2022-04-05 19:38:55',NULL),(95,1,'Часто используемые неправильные глаголы','2022-04-05 19:49:01','2022-04-05 19:49:01',NULL),(96,1,'Глаголы. Отрицание в Present/Past/Future Simple, Continuous','2022-04-13 20:11:08','2022-04-13 20:11:08',NULL),(97,1,'Глаголы. Present/Past/Future Simple/Continuous/Отрицание. Практика всех времен (кроме вопросительного)','2022-04-14 20:25:56','2022-04-14 20:28:23','Здесь будут предложения для практики во всех временах и конструкция, но не вопросительное'),(98,1,'Глаголы. Глагол To have (has)','2022-04-14 20:31:36','2022-04-14 20:31:36','Have для I, we, they, you\r\nHas для she, he, it'),(99,1,'Практика определителей существительных. Same, Other, Another','2022-04-14 20:33:26','2022-04-14 20:33:31',NULL),(101,3,'asd','2022-05-01 14:53:43','2022-05-01 14:53:43','asdasd'),(102,3,'dasd','2022-05-02 14:17:37','2022-05-02 14:17:37','asd'),(103,3,'asd','2022-05-02 17:13:56','2022-05-02 17:13:56','asd'),(104,3,'asdasd','2022-05-02 17:14:02','2022-05-02 17:14:02','asd'),(105,3,'asd','2022-05-02 17:14:09','2022-05-02 17:14:09','asasd'),(106,3,'asdasd','2022-05-02 17:14:15','2022-05-02 17:14:15','asdasd'),(107,3,'asd','2022-05-02 17:14:47','2022-05-02 17:14:47','asdasd'),(108,3,'asdasd','2022-05-02 17:17:07','2022-05-02 17:17:07','asdasd'),(109,3,'asdasd','2022-05-02 17:17:17','2022-05-02 17:17:17','asdasd'),(110,3,'asdasd','2022-05-02 17:17:21','2022-05-02 17:17:21','asdasd'),(111,3,'asdasd','2022-05-02 17:17:26','2022-05-02 17:17:26','adasd'),(112,3,'asdasd','2022-05-02 17:17:33','2022-05-02 17:17:33','asdasd'),(113,3,'asdasd','2022-05-02 17:17:39','2022-05-02 17:17:39','asd'),(114,3,'asdasd','2022-05-02 17:17:49','2022-05-02 17:17:49','asdasd'),(115,3,'asd','2022-05-02 17:18:08','2022-05-02 17:18:08','asdasdasd'),(116,3,'asdasd','2022-05-02 17:18:15','2022-05-02 17:18:15','asdasd'),(117,3,'asdasd','2022-05-02 17:18:21','2022-05-02 17:18:21','asdasd'),(118,3,'asdasd','2022-05-02 17:18:27','2022-05-02 17:18:27','sdasd'),(119,3,'asdasd','2022-05-02 17:18:32','2022-05-02 17:18:32','asdasd'),(120,3,'sdf','2022